import React from 'react';

function Pic() {
  return (
    <>
      <h2>Pic</h2>
      <img src="/home/cathy/Downloads/What (3).jpeg" alt="Pic 1"/>
        <img src="/home/cathy/Downloads/What (2).jpeg"alt="Pic2"/>
        <img src="/home/cathy/Downloads/What (1).jpeg"alt="Pic3"/>
        <img src="/home/cathy/Downloads/What (4).jpeg43eL7" alt="Pic4"/>
        <img src="/home/cathy/Downloads/What(5).jpegBVv6" alt="Pic5"/>
        <img src="https://images.app.goo.gl/cqES2iNQohmKiZcZ9"alt="Pic6"/>

      <button id="like-btn"onclick="toggleLike()">Like</button> 
      <span id="like-count"></span>
    </>
  );
}

export default Pic;
